package toDoTasks;

import java.util.HashMap;

public class FindDifference {

	public char findTheDifference(String s, String t) {
        
		HashMap<Character, Integer> sMap = new HashMap<Character, Integer>();
        HashMap<Character, Integer> tMap = new HashMap<Character, Integer>();
		sMap.clear();
		tMap.clear();
		for(int i =0; i< s.length(); i++)
		{
			if(sMap.get(s.charAt(i)) != null)
			{
				sMap.put(s.charAt(i), sMap.get(s.charAt(i))+1);
			}
			else
			{
				sMap.put(s.charAt(i),1);
			}
			
		}

        for(int k = 0; k<t.length(); k++)
		{
        	if(tMap.get(t.charAt(k)) != null)
			{
        		tMap.put(t.charAt(k), tMap.get(t.charAt(k))+1);
			}
			else
			{
				tMap.put(t.charAt(k),1);
			}
		}
		
		for(int j = 0; j<t.length(); j++)
		{
			Integer ch=-1;
			if(j < s.length())
			{
				ch= sMap.get(t.charAt(j));
			}
			Integer ch2=-1;
			if(j < t.length())
			{
				ch2= tMap.get(t.charAt(j));
			}	
			if(ch != ch2)
			{
				return t.charAt(j);
			}
		}
		return 0;
    }
	
	public static void main(String[] args) {
		FindDifference findDiff = new FindDifference();
		String s = "";
		String t = "";
		Character result = findDiff.findTheDifference(s,t);
	    System.out.println(result);

	}
}
